import React, { Component } from "react";
import "./header.css";

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nodes: [],
    };
    this.handleEventHover = this.handleEventHover.bind(this);
  }

  handleEventHover() {}

  render() {
    return (
      <div>
        <h1>Visual Pathfinder</h1>
        <ul className="node-selection">
          <li
            className="node-type"
            onClick={this.props.startClick}
            onMouseEnter={this.handleEventHover}
          >
            Start
          </li>
          <li className="node-type" onClick={this.props.endClick}>
            End
          </li>
          <li className="node-type" onClick={this.props.wallClick}>
            Wall
          </li>
        </ul>
      </div>
    );
  }
}

export default Header;
